const _hoisted_7 = /* @__PURE__ */ createStaticVNode('<h2 id="info" tabindex="-1"><a class="header-anchor" href="#info" aria-hidden="true">#</a> Info</h2><p><strong>Bio-Data</strong></p><ul><li>Class: Berserker</li><li>True Name: Atalanta</li><li>Gender: Female</li><li>Source: Greek mythology</li><li>Region: Greece</li><li>Alignment: Chaotic Evil</li><li>Height: 166cm</li><li>Weight: 57kg</li></ul><p><strong>Meta</strong></p><ul><li>Scenario Writer: Higashide Yuuichirou</li><li>Character Design: Konoe Ototsugu</li><li>CV: Hayami Saori</li><li>Main Appearances in Works: Fate/Grand Order</li></ul><h2 id="stats" tabindex="-1"><a class="header-anchor" href="#stats" aria-hidden="true">#</a> Stats</h2><table><thead><tr><th style="text-align:left;">Parameters</th><th style="text-align:center;">Values</th></tr></thead><tbody><tr><td style="text-align:left;">Strength</td><td style="text-align:center;">C++</td></tr><tr><td style="text-align:left;">Constitution</td><td style="text-align:center;">C++</td></tr><tr><td style="text-align:left;">Agility</td><td style="text-align:center;">A+</td></tr><tr><td style="text-align:left;">Magical Power</td><td style="text-align:center;">B</td></tr><tr><td style="text-align:left;">Luck</td><td style="text-align:center;">E</td></tr><tr><td style="text-align:left;">Noble Phantasm</td><td style="text-align:center;">B+</td></tr></tbody></table><h2 id="class-skills" tabindex="-1"><a class="header-anchor" href="#class-skills" aria-hidden="true">#</a> Class Skills</h2><p><strong>Beast Enhancement: [B]</strong></p><p>All parameters are raised by two ranks.<br> Despite granting strength equivalent to an A-ranked Madness Enhancement, the skill&#39;s user can remain calm, without losing their reason.</p><p><strong>Independent Action: [A]</strong></p><p>One can keep acting even in the absence of a Master.<br> However, for the vast amounts of mana necessary for something like the utilization of one&#39;s Noble Phantasm, the back up of a Master is necessary.</p><h2 id="personal-skills" tabindex="-1"><a class="header-anchor" href="#personal-skills" aria-hidden="true">#</a> Personal Skills</h2><p><strong>Self Evolution: [EX]</strong></p><p>A skill for improving oneself that surpasses Self Modification.<br> Continuously evolving in order to overcome anything that would hinder the accomplishment of one&#39;s goals.<br> However, it has the demerit of having a reduced general applicability compared to Self Modification due to being overly specialized for one&#39;s objective at hand.</p><p><strong>Crossing Arcadia: [A]</strong></p><p>One can jump over any obstacles on the field, including enemies.</p><p><strong>Wild Beast&#39;s Logic: [B]</strong></p><p>A combat-focused thought process resulting from transforming into a beast.<br> It can&#39;t be used for finding weak points, but the speed of mental processes executed for the sake of swiftly murdering the enemy is accelerated.<br> By combining this with the Self Evolution skill, the speed at which enemies are defeated increases even further.</p><h2 id="noble-phantasm-s" tabindex="-1"><a class="header-anchor" href="#noble-phantasm-s" aria-hidden="true">#</a> Noble Phantasm(s)</h2><h1 id="tauropolos-eklipsi-the-archery-that-eclipses-the-darkened-heavens-1" tabindex="-1"><a class="header-anchor" href="#tauropolos-eklipsi-the-archery-that-eclipses-the-darkened-heavens-1" aria-hidden="true">#</a> Tauropolos Eklipsi: The Archery That Eclipses The Darkened Heavens[1]</h1><ul><li>Rank: A</li><li>Classification: Anti-Unit Noble Phantasm</li><li>Range: 1~99</li><li>Maximum number of targets: 1</li></ul><p>\u03C4\u03B1\u03C5\u03C1\u03BF\u03C0\u03BF\u03BB\u03BF\u03C2 \u03AD\u03BA\u03BB\u03B5\u03B9\u03C8\u03B7.<br> Atalanta pours all of her mana into the Tauropolos she normally uses and releases a single shot.<br> Rather than an arrow, it would be more apt to call it an enormous missile.<br> The devoured opponent is absorbed by a viscous &quot;darkness&quot; and assimilated.<br> To resist this, an extremely powerful Magic Resistance skill is necessary.</p><h1 id="character" tabindex="-1"><a class="header-anchor" href="#character" aria-hidden="true">#</a> Character</h1><h2 id="pronouns" tabindex="-1"><a class="header-anchor" href="#pronouns" aria-hidden="true">#</a> Pronouns</h2><p>First person pronoun: watashi (\u79C1)<br> Second person pronoun: nanji (\u6C5D)<br> Third person pronoun: are (\u3042\u308C)/sore (\u305D\u308C)</p><h2 id="personality" tabindex="-1"><a class="header-anchor" href="#personality" aria-hidden="true">#</a> Personality</h2><p>Atalanta was summoned with her second Noble Phantasm, the Wild Boar of Divine Punishment (Agrius Metamorphosis) in use.</p><p>Despite taking the form of a Demonic Beast with the Pelt of the Calydonian Boar and having her stats raised to the equivalent of one with A-ranked Mad Enhancement, she&#39;s a rare existence that can keep a cool head.<br> Instead of being a transformation through giving in to her rage, she&#39;s been summoned in a state where she has already become a beast. As a result, its rank is lowered compared to when it is used as a Noble Phantasm.<br> If an optimal way of bringing down her opponent can be realized, depending on the circumstances, even retreat would be considered acceptable.<br> However, once the other party has been deemed as an enemy, it is fundamentally impossible for them to persuade her.</p><h2 id="attitude-towards-master" tabindex="-1"><a class="header-anchor" href="#attitude-towards-master" aria-hidden="true">#</a> Attitude Towards Master</h2><p>She is like a tiger.<br> In other words, no matter how attached it got to them, a beast will remain a beast, and even if they are the parents that raised it, it will bite them in an impulsive moment.<br> On the flip side, even if she is a beast, she&#39;ll get all cuddly when she gets attached to them.<br> She&#39;ll even purr and wag her tail.</p><h2 id="dialogue-examples" tabindex="-1"><a class="header-anchor" href="#dialogue-examples" aria-hidden="true">#</a> Dialogue Examples</h2><p>&quot;I&#39;m not wrong! I&#39;m not mistaken! Aa...Aaaaaaah! Tauropolos, goo!!&quot;</p><p>&quot;...It&#39;s peaceful, isn&#39;t it... So this is the true land of the end... I&#39;m, a bit sleepy...Stay quiet...Aah...So there is light, even at the farthest ends...&quot;</p><p>&quot;I, as a hero\u2500\u2500\u2500\u2500No matter what, I can&#39;t forsake them.&quot;</p><h2 id="character-in-fgo" tabindex="-1"><a class="header-anchor" href="#character-in-fgo" aria-hidden="true">#</a> Character in FGO</h2><p>In Fate/Apocrypha, when she found herself in an inevitable confrontation with Ruler, Jeanne D&#39;Arc, by employing her second Noble Phantasm, Atalanta went through a transformation.<br> That form is what served as a foundation for the summoning of this different aspect of Atalanta.</p><p>To her, who strives for a world where all children are loved, the fact that a Saint of all people sacrificed an innocent child was unbearably agonizing, and reason enough for vengeance.</p><p>Logical persuasions are completely ineffective on her in this state.<br> As a beast, her logic is based on the &quot;defeat of the opponent&quot; and she devotes her all towards that goal.</p><p>As compensation for her heightened ferocity, she has to put up with constant sharp headaches.<br> Due to this, she does not get attached to others that easily. However, on the other hand, because the original Atalanta&#39;s nature remains, she by no means will ever act aggressive towards the Master and will go out of her way to look after children.</p><p>The outfit covering her body is the &quot;Wild Boar of Divine Punishment&quot; and if it was to be peeled off, she&#39;d return to being an Archer.</p><h2 id="standard-weapons" tabindex="-1"><a class="header-anchor" href="#standard-weapons" aria-hidden="true">#</a> Standard Weapons</h2><p>The Bow of the Darkened Heavens, Tauropolos.<br> The arrows are created out of mana.</p><h2 id="related-characters" tabindex="-1"><a class="header-anchor" href="#related-characters" aria-hidden="true">#</a> Related Characters</h2><p><strong>Jeanne d&#39;Arc</strong></p><p>There is still lingering resentment, but she tries her best to appear unperturbed.<br> Be that as it may, her tails are raised and bristling, perhaps from her wariness.</p><p><strong>Jack the Ripper</strong></p><p>Please, grant that child salvation.<br> She keeps on wishing for such a thing, even though she understands that she does not have the right to do so.</p><p><strong>Children Servants other than Jack</strong></p><p>Constantly worrying about how to make them like her with a difficult look on her face.<br> (Said expression is probably not helping)<br> &quot;I should make that guy on my shoulder fancily...!&quot; is the flash of inspiration she receives, but that&#39;s highly unlikely to succeed.</p><p><strong>Achilles</strong></p><p>She is grateful to him for stopping her past self.<br> However, the fact that he calls both her and her Archer version &#39;big sis&#39; gives her slightly conflicting feelings.</p><p><strong>Jeanne d&#39;Arc (Alter)</strong></p><p>A-a different aspect of that saint woman? And what&#39;s more, she&#39;s in all black?<br> And also, why does it feel like we would get along well and both be bad at games...why...just why is that!?</p><h2 id="comment-from-the-illustrator" tabindex="-1"><a class="header-anchor" href="#comment-from-the-illustrator" aria-hidden="true">#</a> Comment from the Illustrator</h2><p>&quot;Let&#39;s make the first or last a cute and cool dress!&quot; is what I decided on and this is how it turned out. The ferocity of tearing her chains apart as she dashes out was also incorporated into the design. ...In other words, just where was she kept? Having her tail increase in numbers as she grows strong is quite the bargain. And then, it might become a weak point which, when grasped, would make her unable to muster any strength. It is presumed that she got the power of the beast under control in her third stage and clad herself in armor with it. (Konoe Ototsugu)</p><h2 id="tl-notes" tabindex="-1"><a class="header-anchor" href="#tl-notes" aria-hidden="true">#</a> TL notes</h2><p>[1] Tauropolos is the name of Atalanta&#39;s bow, the Bow of Heaven, which comes from one of Artemis&#39; epithets. Said epithet is interpreted to mean &quot;worshipped at Tauris&quot;, &quot;pulled by a yoke of bulls&quot;, or &quot;hunting bull goddess&quot;. There was also a festival of Artemis in Athens known as Tauropolia. Eklipsi (\u03AD\u03BA\u03BB\u03B5\u03B9\u03C8\u03B7) is Greek for eclipse.</p><h2 id="material-images" tabindex="-1"><a class="header-anchor" href="#material-images" aria-hidden="true">#</a> Material Images</h2><p>(Lib will add after publish)</p><h2 id="dialogue" tabindex="-1"><a class="header-anchor" href="#dialogue" aria-hidden="true">#</a> Dialogue</h2><table><thead><tr><th style="text-align:left;">Occassion</th><th style="text-align:center;">English</th><th style="text-align:center;">Japanese</th></tr></thead><tbody><tr><td style="text-align:left;">Summoned</td><td style="text-align:center;"></td><td style="text-align:center;"></td></tr></tbody></table>', 62);
